import { StatusBar } from 'expo-status-bar';
import React from 'react';

import { initializeApp, getApps, getApp } from "firebase/app";
import * as firebase from 'firebase';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const firebaseConfig = {

  apiKey: "AIzaSyCxecqkrYRR1YDUJ3jH1pi_27dq8ZTrwU8",

  authDomain: "the-tent-49a6c.firebaseapp.com",

  projectId: "the-tent-49a6c",

  storageBucket: "the-tent-49a6c.appspot.com",

  messagingSenderId: "604090091698",

  appId: "1:604090091698:web:807449591fc046231021ab",

  measurementId: "G-EGVN4SR9GQ"

};

  initializeApp(firebaseConfig);

import LandingScreen from './components/auth/Landing'
import RegisterScreen from './components/auth/Register';

const Stack = createStackNavigator();
export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initiaRouteName="Landing">
        <Stack.Screen name="Landing" component={LandingScreen} options={{ headerShown: false }} />
        <Stack.Screen name="Register" component={RegisterScreen} />

      </Stack.Navigator>
    </NavigationContainer>
  );
}
